export const getPlayersBySpecialism = (specialism: string): Player[] => {
  return auctionPlayers.filter(p => p.specialism === specialism);
};

export const searchPlayers = (query: string): Player[] => {
  const lowerQuery = query.toLowerCase();
  return auctionPlayers.filter(p =>
    p.fullName.toLowerCase().includes(lowerQuery) ||
    p.firstName.toLowerCase().includes(lowerQuery) ||
    p.surname.toLowerCase().includes(lowerQuery) ||
    p.country.toLowerCase().includes(lowerQuery)
  );
};
